package com.zhzx.dao.model.prod;import com.zhzx.dao.model.BaseModel;public class ProdInfoModel extends BaseModel {		/**	*商品编号	*/	private String id;		/**	*商品名称	*/	private String name;		/**	*商品展示名称	*/	private String displayname;		/**	*商品数量	*/	private Integer stock;		/**	*商品状态（下架：0，正常销售：1）	*/	private String status;		/**	*商品价格	*/	private String price;		/**	*商品URL地址	*/	private String url;		/**	*商品描述	*/	private String discribe;		/**	*	*/	private String createtime;		/**	*	*/	private String updatetime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getName() {	    return this.name;	}	public void setName(String name) {	    this.name=name;	}	public String getDisplayname() {	    return this.displayname;	}	public void setDisplayname(String displayname) {	    this.displayname=displayname;	}	public Integer getStock() {	    return this.stock;	}	public void setStock(Integer stock) {	    this.stock=stock;	}	public String getStatus() {	    return this.status;	}	public void setStatus(String status) {	    this.status=status;	}	public String getPrice() {	    return this.price;	}	public void setPrice(String price) {	    this.price=price;	}	public String getUrl() {	    return this.url;	}	public void setUrl(String url) {	    this.url=url;	}	public String getDiscribe() {	    return this.discribe;	}	public void setDiscribe(String discribe) {	    this.discribe=discribe;	}	public String getCreatetime() {	    return this.createtime;	}	public void setCreatetime(String createtime) {	    this.createtime=createtime;	}	public String getUpdatetime() {	    return this.updatetime;	}	public void setUpdatetime(String updatetime) {	    this.updatetime=updatetime;	}	}